import React from "react";

import frontPageItems from "../frontpageData";
import {ListItem} from './ListItem';

export class RrHNApp extends React.Component {
  state = {
    items: frontPageItems,
  };

  render() {
    return (
      <div className="App">
        <ListItem item={frontPageItems[0]} />
      </div>
    );
  }
}
